column2:
@BordoniAndres @Loopifyyy Digital video game assets are already made scarce in almost every video game.

FIFA, CSGO, COD, Roblox, etc

Not sure what games you're playing that don't have scarce collectible assets.

@FestiveAurora @Desperado_Dave @keepfischin @TRF_Stories @DappRadar @beeple Beeple was the reason I got into NFTs. 

There are many artists, go look at @niftygateway "curated drops" 

Check out @refikanadol and @BD_White to name a few.

@Queso_Ok @TRF_Stories @DappRadar You're calling tech a scam. Tech can be used for scams, but it's not a scam. 

There are loads of scams on YouTube. It doesn't make YouTube a scam. 

NFTs will be used by businesses for things like concert tickets. Think bigger.

@Netbug009 @TRF_Stories @DappRadar YouTube was bought in 2006. 

The feature you're talking about came out recently, 10+ years later. 

NFTs just started. You want solutions instantly?

@Monopoly907 @TRF_Stories @DappRadar I've been a full-time YouTuber since 2009. 

I was referring to my YouTube content, not NFTs. 

NFTs are tech, and the tech isn't going away. If you believe it is, you should watch some videos to learn more.

@Desperado_Dave @TRF_Stories @DappRadar You're judging an entire industry in the earliest stage of development. 

In the early days of YouTube, the entire website was mostly stolen videos with only a few creators taking it seriously creating original content. 

Now, YouTube helps millions of people have a job/career.

@SYNtroopeR_NOIA @SlenderCrypto Bought $FTM at a few cents, held for 6-7 months, and sold for a loss. 

Price shot up a few weeks later. 

Won't make that mistake again.
